import Vue from 'vue'

import Router from 'vue-router'

// 团队项目组件
import more from "./components/team/more.vue"

import index from "./components/douban/index.vue"
import left from "./components/douban/list/left.vue"
Vue.use(Router)

export default new Router({
  routes: [

    //团队项目
    {path:'/more',component:more},

    {path:'/index',component:index},
    {path:'/left', component:left},
  ]
})
